  CONSTRAINT `FK_ExperimentMetadata_Project_ProjectId` FOREIGN KEY (`ProjectId`) REFERENCES `Project` (`Id`),
  CONSTRAINT `FK_ExperimentMetadata_Sample_SampleId` FOREIGN KEY (`SampleId`) REFERENCES `Sample` (`Id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
