c-f31be35c2fc4','external','Ciisb',NULL,'08d9dbd9-9eff-46f5-8cb6-42ab259017a8','TalosArctica','Ahoj,\n\nmuzes si stahnout obrazky ze vzorku s 0.5mM koncentraci vacku. Bohuzel neudelal zatim dost fotek pri nastaveni, ktere jsem chtel, takze rozumnych fotek je tam jenom. Na druhou stranu mi z toho prijde vice nez patrne, ze se peptidy nejak integruji do membrany. Pory z toho nejsou videt. Udelam vic obrazku a zkusim na tom namerit tomogram. Od toho si moc neslibuji, ale zkusme to.\n\nDelsi inkubaci vacku pri vyssi teplote zkusime - dobry napad.\n\n','','','','','','','','','08d9dcca-344f-4777-8346-0448e7001a9a'),('08d9dd1a-9b4d-44ac-8628-c4067510eb49','CEMCOF,EM-Instruct-CZ,Brno','2022-01-21 20:14:19.000000','0001-01-01 00:00:00.000000','2022-01-22 18:03:51.000000','08d9aa96-3527-450c-8a33-fedf5c637bf1','08d9dbd9-46ea-4977-851c-f31be35c2fc4','internal','Ciisb',NULL,'08d9dbd9-9eff-46f5-8cb6-42ab259017a8','Versa3D','','','','','','','','','','08d9dd1a-9b4d-4564-8ec5-584d75cddea2'),('08d9de8e-068e-4f6b-8ef9-e078994c193a','CEMCOF,EM-Instruct-CZ,Brno','2022-01-23 16:33:02.000000','0001-01-01 00:00:00.000000','2022-01-23 16:37:05.000000','08d9aa96-3527-450c-8a33-fedf5c637bf1','08d9dbd9-46ea-4977-851c-f31be35c2fc4','external','Ciisb',NULL,'08d9dbd9-9eff-46f5-8cb6-42ab259017a8','Versa3D','toto jsou lepsi data bakterii v SEM. Jedna se porad o samotne bakterie bez peptidu. Obrazky 6-10 uz mi prijdou pekne. Pokud tedy souhlasis, tak bychom stejnym zpusobem udelali obrazky bakterii s peptidem. Pro to budeme potrebovat cerstvy vzorek bakterii, tomu aktualnimu uz bych neveril.\n','','','','','','','','','08d9de8e-068f-4064-87d9-9f31b9ddb5c5'),('08d9df2f-d4a0-43a6-89f1-531ca8af731a','CEMCOF,EM-Instruct-CZ,Brno','2022-01-24 11:51:17.000000','0001-01-01 00:00:00.000000','2022-01-24 11:59:06.000000','08d9b9d6-4a41-4a01-82bc-97e12a89f653','08d9b9d6-4a41-4a01-82bc-97e12a89f653','internal','Ciisb','08d9dbf6-fc55-4b15-8ef6-89b5df3821f8','08d9be4c-640e-4ef7-8a16-09d42eadb864','TalosF200C','